    'updatesSmartUpdatePromo.default.text' => 'Váš web je zastaraly - hrozí mu nebezpečí napadení %%popover%%. Chraňte jej pomocí Automatických aktualizací - identifikují, simulují a aplikují potřebně aktualizace bez narušení aktivního webu. Co víc si přát? 1 měsíc na zkoušku zdarma, bez dalších podmínek.',
