    'updatesSmartUpdatePromo.default.popoverText' => 'Věděli jste? Zaútočit mohou nejen lidé, ale i software. Automatické útoky jsou zpravidla prováděny pomocí počítačových programů, než ručně, kdy útočník provádí postupné fáze napadení. Cíle jsou voleny náhodně – napaden může být v podstatě úplně každý. Chraňte se a zachovejte své systémy aktuální. K automatické aplikaci aktualizací použijte funkci Inteligentní aktualizace s nástrojem WP Toolkit. První měsíc na zkoušku zdarma, bez dalších podmínek.',
