    'updatesSmartUpdatePromo.1.popoverTrigger' => 'kdykoli',
    'updatesSmartUpdatePromo.1.popoverText' => 'Věděli jste, že průniky a útoky nyní probíhají automaticky? Za oponou už nestojí lidé – jedná se o počítačový program. Cíle automatizovaných průniků a útoků jsou náhodné. Takže se mohou vztahovat na každého – včetně vás. Jak se sami chráníte? Použijte automatické aktualizace prostřednictvím funkce Inteligentní aktualizace s nástrojem WP Toolkit. První měsíc na zkoušku zdarma – bez dalších podmínek.',

